/* Calcular límites de precio para cálculos de color, medias provinciales */
function computeLimits(option) {
	var max=-10;
	var min=10;
	for (var p in data.provinces) {
		if (skipProv(p)) continue;
		var prov = data.provinces[p];
		if (prov._p.hasOwnProperty(option)) {
			var price = prov._p[option].m;
			if (price > max) max = price;
			if (price < min) min = price;
		}
	}
	X_MAX = max;
	X_MIN = min;
	document.getElementById("bar_min").textContent = X_MIN.toFixed(3);
	document.getElementById("bar_max").textContent = X_MAX.toFixed(3);
}

function computeGoLimits(option) {
	G_MAX = d3.max(data._g[option].h, function(array) {
		return d3.max(array);
	});
	G_MAX = Math.log(G_MAX);
}


function circle2path(x , y, r) // x and y are center and r is the radius
{
	// https://groups.google.com/forum/#!topic/raphaeljs/6gH8TiOWlAw
	var s = "M";
	s = s + "" + (x) + "," + (y-r) + "A"+r+","+r+",0,1,1,"+(x-0.1)+","+(y-r)+"z";
	return s;
}

