// Histogramas, distribuciones…
function computeChartData(gasole, nbins) {
	// Inicializa un histograma a cero
	function initHist() {
		var hist = [];
		var _nbins = nbins;
		while (_nbins--) hist[_nbins]=0;
		return hist;
	}
	// Inicializa todas las marcas en un lugar
	function initBrands() {
		var r = {};
		for (var i=0, l=BRANDS.length; i<l; i++) {
			r[BRANDS[i]] = {"n": 0, "hist":initHist()};
		}
		return r;
	}
	// Nuevo precio (price) en estadístico de marca (brand) y aumento del #bin pricebin
	function addData(where, price, pricebin) {
		where.n++;				// nueva estación
		if (where.n==1) {		// es la primera
			where.max = where.min = where.mu = price;
		} else {
			if (price>where.max) where.max=price;
			else if (price<where.min) where.min=price;
			where.mu = (where.mu*(where.n-1)+price)/where.n;
		}
		where.hist[pricebin]++;
	}
	var data = gasole.info;						// La información completa de la API
	var sAll = gasole.stats.stats; 				// Estadísticas de toda españa
	var sProvs = gasole.stats.provinces;		// estadísticas de las provincias
	for (var type in sAll) {
		var bins = [];
		var step = (sAll[type].max-sAll[type].min)/nbins;
		for (var n=0; n<nbins; n++) 
			bins[n] = sAll[type].min+n*step;
		bins.push(sAll[type].max);
		sAll[type].bins = bins;
		sAll[type].brands = initBrands();
		sAll[type].hist = initHist();
		for (var p in sProvs)
			if (sProvs[p].hasOwnProperty(type)) {
				sProvs[p][type].brands = initBrands();
				sProvs[p][type].hist = initHist();
			} 
	}
	for (var p in data) {						// para todas las provincias
		var pdata = data[p];
		var sProvCurrent = sProvs[p];
		for (var t in pdata) {
			var tdata = pdata[t];
			for (var s in tdata) {
				var sdata = tdata[s];			// información de la estación
				var brand = checkBrand(sdata.l);
				for (var o in sdata.o) {
					var price = sdata.o[o];
					var b = sAll[o].bins.length-1;
					while (b>0) {
						if (sAll[o].bins[b]<price) break;
						b--;
					}
					addData(sProvCurrent[o].brands[brand], price, b);
					addData(sAll[o].brands[brand], price, b);
					sProvCurrent[o].hist[b]++;
					sAll[o].hist[b]++;
				}
			}
		}
	}
}

function updateAll(g) {
	drawRadar(g);	
	drawHist(g);
}

